import './Gallery.css';
import dataSlider from './dataSlider';
import BtnSlider from './BtnSlider'; 

const Gallery = () => {
    return (
        <div className="container-slider">
            {dataSlider.map((obj, index) => {
                return (
                    <div className="slide">
                        <img src={process.env.PUBLIC_URL + '/Images/img${index+1}.jpg'}></img>
                    </div>
                )
            })}
            <BtnSlider></BtnSlider>
            <BtnSlider></BtnSlider>
        </div>    

    ); 
}

export default Gallery; 

